int vx[4] = {-1, 0, 1, 0}, vy[4] = {0, -1, 0, 1};

bool search(int cnt, int n) {
	if (cnt == pass.size() - 1) return true;

	bool ret = false;

	for (int i = 0; i < 4; ++i) {
		int nx = n / 3 + vx[i], ny = n % 3 + vy[i];

		if (0 <= nx && nx <= 3 && 0 <= ny && ny <= 3) {
			if (pass[cnt + 1] == s[nx][ny]) {
				ret = search(cnt + 1, pass[cnt + 1] - 'A');
				if (ret) return ret;
			}
		}
	}

	return false;
}

