char locker[3][3] ={{'A', 'B', 'C'},
		    {'D', 'E', 'F'},
		    {'G', 'H', 'I'}};
int dx[4] = {1, 0, -1, 0};
int dy[4] = {0, 1, 0, -1};

bool dfs(string s, int x, int y){
  if(s.empty()){
    return true; 
  }
  bool res = false;
  for (int i = 0; i < 4; i++){
    int nx = x + dx[i];
    int ny = y + dy[i];
    if(0 <= nx && nx < 3 &&
       0 <= ny && ny < 3 &&
       s[0] == locker[ny][nx])
      res = res | dfs(s.substr(1), nx, ny);
  }
  return res;
}

int main(){
  for (int i = 0; i < 1000; i++){
    int x, y;
    string s;
    cin >> s;
    for (int i = 0; i < 3; i++){
      for (int j = 0; j < 3; j++){
	if(s[0] == locker[i][j]){
	  x = j;y = i;
	}
      }
    }

    if(dfs(s.substr(1), x, y))
      cout << s << endl;
  }
  return 0;
}

