#include <array>
using namespace std;

const array<int, 4> dir = {-3, 1, 3, -1};

string buttons =
	"ABC"
	"DEF"
	"GHI";

bool neigh(char c, char x) {
	auto p = buttons.find(c);
	for (int d : dir) {
		try {
			if (buttons.at(p + d) == x) return true;
		}
		catch (...) {continue;}
	}
	return false;
}

bool solve(const string& s) {
	char c;
	array<int, 9> buttons = {0};

	for (auto it = s.begin(); it != s.end(); ++it) {
		if (it != s.begin() && !neigh(c, *it)) {
			return false;
		}
		c = *it;

		if (it == s.begin() || it + 1 == s.end()) {
			buttons[(*it) - 'A']++;
		}
		else {
			buttons[(*it) - 'A'] += 2;
		}
	}
	int odd = 0;
	for (int& x : buttons) {
		odd += (x & 1);
	}
	return odd <= 2;
}

int main() {
	string s;
	while (cin >> s) {
		if (solve(s)) {
			cout << s << endl;
		}
	}
	return 0;
}

