Pi Find(const char& c){
  static const string mas[] = {"ABC","DEF","GHI"};
  for(int i = 0; i < 3; i++){
    if(mas[i].find(c) != string::npos){
      return make_pair( i, mas[i].find(c));
    }
  }
}

int main(){
  string s;
  for(int i = 0; i < 1000; i++){
    cin >> s;

    bool ok = true;
    Pi pos = Find(s[0]);
