bool sol(string st){
  int i;
  bool flag=true;
  for(i=0;i<st.size()-1;i++){
    if(!flag) break;
    if(st[i]=='A'){
      if(!(st[i+1]=='B'||st[i+1]=='D')) flag=false;
    }
    if(st[i]=='B'){
      if(!(st[i+1]=='A'||st[i+1]=='C'||st[i+1]=='E')) flag=false;
    }
    if(st[i]=='C'){
      if(!(st[i+1]=='B'||st[i+1]=='F')) flag=false;
    }
    if(st[i]=='D'){
      if(!(st[i+1]=='A'||st[i+1]=='E'||st[i+1]=='G')) flag=false;
    }
    if(st[i]=='E'){
      if(!(st[i+1]=='B'||st[i+1]=='D'||st[i+1]=='F'||st[i+1]=='H')) flag=false;
    }
    if(st[i]=='F'){
      if(!(st[i+1]=='C'||st[i+1]=='E'||st[i+1]=='I')) flag=false;
    }
    if(st[i]=='G'){
      if(!(st[i+1]=='D'||st[i+1]=='H')) flag=false;
    }
    if(st[i]=='H'){
      if(!(st[i+1]=='G'||st[i+1]=='E'||st[i+1]=='I')) flag=false;
    }
    if(st[i]=='I'){
      if(!(st[i+1]=='F'||st[i+1]=='H')) flag=false;
    }
  }
  return flag;
}

int main(){
  int i;
  string s;
  for(i=0;i<N;i++){
    cin>>s;
    if(sol(s)) cout<<s<<endl;
  }
  return 0;
}

