const array<int, 4> dir = {-3, 1, 3, -1};

bool neigh(char c, char x) {
	for (int d : dir) {
		if (static_cast<char>(c + d) == x) return true;
	}
	return false;
}

bool solve(const string& s) {
	char c;
	for (auto it = s.begin(); it != s.end(); ++it) {
		if (it != s.begin() && !neigh(c, *it)) {
			return false;
		}
		c = *it;
	}
	return true;
}

int main() {
	string s;
	while (cin >> s) {
		if (solve(s)) {
			cout << s << endl;
		}
	}
