class Template
{
	static Scanner sc;
	static int N = 1000;
	static int M = 3;
	static char[,] lo = { { 'A', 'B', 'C' }, { 'D', 'E', 'F' }, { 'G', 'H', 'I' } };
	static int[] dx = { 1, -1, 0, 0 };
	static int[] dy = { 0, 0, 1, -1 };

	public static void Main(string[] args)
	{
		sc = new Scanner();
		LinkedList<string> ans = new LinkedList<string>();
		for (int i = 0; i < N; i++)
		{
			string s = sc.next();
			if (check(s, 0)) ans.AddLast(s);
		}
		foreach (var el in ans)
		{
			Console.WriteLine(el);
		}
	}

	static bool inside(int x, int y)
	{
		bool res = true;
		if (x < 0 || x >= M) res = false;
		if (y < 0 || y >= M) res = false;
		return res;
	}

	static bool check(string s, int id)
	{
		if (id == s.Length) return true;
		if (id == 0)
		{
			return check(s, 1);
		}
		if (s[id - 1] == s[id]) return false;

		int bx = 0, by = 0;
		for (int i = 0; i < M; i++)
		{
			for (int j = 0; j < M; j++)
			{
				if (s[id - 1] == lo[i, j])
				{
					bx = j; by = i;
					i = M; j = M;
				}
			}
		}

		bool res = false;
		for (int i = 0; i < 4; i++)
		{
			int nex = bx + dx[i];
			int ney = by + dy[i];
			if (!inside(nex, ney)) continue;
			if (lo[ney, nex] == s[id]) res = check(s, id + 1);
		}
		return res;
	}
}

